import React from "react";
import { ThemeContext } from "../../context/Theme";
import { useContext, useState, useEffect } from "react";

export const FeedBackDetails = ({ setSelected }) => {
  const [theme, setTheme] = useContext(ThemeContext);

  return (
    <div className="flex flex-col items-center justify-center h-screen bg-gray-200 px-8">
      <div className="w-full max-w-4xl overflow-hidden rounded-lg text-sm md:text-lg h-full flex-grow">
        <div
          className={`flex w-full rounded-xl h-20 shadow-lg p-6 justify-between items-center font-bold ${
            theme === "night" ? "bg-night text-white" : "bg-fantasy text-black"
          }`}
        >
          <h1 className="text-3xl font-bold">Details</h1>
          <button
            id="btn_add_item"
            onClick={() => setSelected("AddItem")}
            className="px-6 py-3 bg-blue-500 text-white rounded-lg hover:bg-blue-600"
          >
            Add Item
          </button>
        </div>
        <div className="grid grid-cols-2 gap-8 text-lg">
          <label className="font-semibold">Title:</label>
          <span>Title Value</span>

          <label className="font-semibold">Username:</label>
          <span>Username Value</span>

          <label className="font-semibold">Type:</label>
          <span>Type Value</span>

          <label className="font-semibold">Date Created:</label>
          <span>Date Value</span>

          <label className="font-semibold">Description:</label>
          <span>Description Value</span>
        </div>
      </div>
    </div>
  );
};

export default FeedBackDetails;
